        <div className=" py-16 px-8 flex flex-wrap flex-column justify-between items-center">
          <div><p className='text-white'>Hello</p></div>
          <div className='bg-black'><p className='text-white'>Hello</p></div>
        </div>
      </div>  
      <div className="flex  container w-full mx-auto relative justify-between">
          <div className=" bg-green-500 w-4/12">oremloremloremlorem</div>
         <div className='bg-black w-6/12 flex flex-col'>
           <div className=" bg-green-500">aaaaa</div>
          <div className=" bg-black">aaas</div>
         </div>
      </div>
    </div>

  );
}
}
export default App;
